ton\u0027\nfull$FsizeD[full$Fsize \u003c 5 \u0026 full$Fsize \u003e 1] \u003c- \u0027small\u0027\nfull$FsizeD[full$Fsize \u003e 4] \u003c- \u0027large\u0027\n\n# Show family size by survival using a mosaic plot\nmosaicplot(table(full$FsizeD, full$Survived), main=\u0027Family Size by Survival\u0027, shade=TRUE)\n\n\n\ncat(paste(\u0027We will infer their values for **embarkment** based on present data that we can imagine may be relevant: **passenger class** and **fare**. We see that they paid\u003cb\u003e $\u0027, full[c(62, 830), \u0027Fare\u0027][[1]][1], \u0027\u003c/b\u003eand\u003cb\u003e $\u0027, full[c(62, 830), \u0027Fare\u0027][[1]][2], \u0027\u003c/b\u003erespectively and their classes are\u003cb\u003e\u0027, full[c(62, 830), \u0027Pclass\u0027][[1]][1], \u0027\u003c/b\u003eand\u003cb\u003e\u0027, full[c(62, 830), \u0027Pclass\u0027][[1]][2], \u0027\u003c/b\u003e. So from where did they embark?\u0027))\n\n\n\n# We can inspect the train data. The results of this are printed in the log tab below\nsummary(train)\n\n\na\u003c-array(1:10)\n\n# Here we will plot the passenger survival by class\ntrain$Survived \u003c- factor(train$Survived, levels=c(1,0))\nlevels(train$Survived) \u003c- c(\u0022Survived\u0022, \u0022Died\u0022)\ntrain$Pclass \u003c- as.factor(train$Pclass)\nlevels(train$Pclass) \u003c- c(\u00221st Class\u0022, \u00222nd Class\u0022, \u00223rd Class\u0022)\n\npng(\u00221_survival_by_class.png\u0022, width=800, height=600)\nmosaicplot(train$Pclass ~ train$Survived, main=\u0022Passenger Survival by Class\u0022,\n           color=c(\u0022#8dd3c7\u0022, \u0022#fb8072\u0022), shade=FALSE,  xlab=\u0022\u0022, ylab=\u0022\u0022,\n           off=c(0), cex.axis=1.4)\ndev.off()\n\n\n\n\n\n\n\n\n\n","dateCreated":"2017-03-15T22:16:57.79Z"},"kernelRun":{"id":1009605,"kernelId":211571,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"titanic","dateCreated":"2017-03-15T22:16:57.79Z","dateEvaluated":"2017-03-15T22:16:58.21Z","workerC \n\n\n\nfull$Surname \u003c- gsub(\u0027(,.*)\u0027,\u0027\u0027,full$Name)\n\nprint(full$Surname)\n\n\n\n# Create a family size variable including the passenger themselves\nfull$Fsize \u003c- full$SibSp + full$Parch + 1\n\n# Create a family variable \nfull$Family \u003c- paste(full$Surname, full$Fsize, sep=\u0027_\u0027)\n\n\n\n# Use ggplot2 to visualize the relationship between family size \u0026 survival\nggplot(full[1:891,], aes(x = Fsize, fill = factor(Survived))) +\n  geom_bar(stat=\u0027count\u0027, position=\u0027dodge\u0027) +\n  scale_x_continuous(breaks=c(1:11)) +\n  labs(x = \u0027Family Size\u0027) +\n  theme_few()\n\n\n\n\n# Discretize family size\nfull$FsizeD[full$Fsize == 1] \u003c- \u0027singleton\u0027\nfull$FsizeD[full$Fsize \u003c 5 \u0026 full$Fsize \u003e 1] \u003c- \u0027small\u0027\nfull$FsizeD[full$Fsize \u003e 4] \u003c- \u0027large\u0027\n\n# Show family size by survival using a mosaic plot\nmosaicplot(table(full$FsizeD, full$Survived), main=\u0027Family Size by Survival\u0027, shade=TRUE)\n\n\n\ncat(paste(\u0027We will infer their values for **embarkment** based on present data that we can imagine may be relevant: **passenger class** and **fare**. We see that they paid\u003cb\u003e $\u0027, full[c(62, 830), \u0027Fare\u0027][[1]][1], \u0027\u003c/b\u003eand\u003cb\u003e $\u0027, full[c(62, 830), \u0027Fare\u0027][[1]][2], \u0027\u003c/b\u003erespectively and their classes are\u003cb\u003e\u0027, full[c(62, 830), \u0027Pclass\u0027][[1]][1], \u0027\u003c/b\u003eand\u003cb\u003e\u0027, full[c(62, 830), \u0027Pclass\u0027][[1]][2], \u0027\u003c/b\u003e. So from where did they embark?\u0027))\n\n\n\n# We can inspect the train data. The results of this are printed in the log tab below\nsummary(train)\n\n\na\u003c-array(1:10)\n\n# Here we will plot the passenger survival by class\ntrain$Survived \u003c- factor(train$Survived, levels=c(1,0))\nlevels(train$Survived) \u003c- c(\u0022Survived\u0022, \u0022Died\u0022)\ntrain$Pclass \u003c- as.factor 3c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the “ground truth”) for each passenger. Your model will be based on “features” like passengers’ gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancés were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, step
